import React, {Component} from 'react';
import {Form} from "react-bootstrap";
import baseService from '../services/baseService'
import Table from "react-bootstrap/Table";
import 'react-confirm-alert/src/react-confirm-alert.css'; // Import css

class Visitors extends Component {
    state = {
        visitors: [],
        loading: true,

    };

    componentWillMount() {
        console.log('categories will mount')
        baseService.getVisitors().then((visitors) => this.setState({
            visitors,
            loading: false
        })).catch((err) => console.log(err));
    }


    render() {
        return (
            <div>
                <h2>Visitors</h2>


                <Form>\

                    <Table striped bordered hover>
                        <thead>
                        <tr>
                            <th>#</th>
                            <th>Icon</th>
                            <th>Category Name</th>
                            <th>Category Name (Ar)</th>
                            <th>SubCategories</th>
                            <th>Actions</th>
                        </tr>
                        </thead>
                        <tbody>

                        {this.state.visitors.length > 0 ? this.state.visitors.map((visitors, index) => {
                            return (
                                <tr>
                                    <td>{index}</td>

                                </tr>
                            )
                        }) : <tr>
                            <td colSpan="6">
                                <center>No Visitors yet</center>
                            </td>
                        </tr>}

                        </tbody>
                    </Table>
                </Form>



            </div>
        );
    }
}

export default Visitors;
